} void loop() { noInterrupts(); auto res = ld06.get_scan(); interrupts(); // Check if we have a scan frame if (res) { auto scan_res = *res; // Check if frame erred if (scan_res) { auto maybe_scan = scan_builder.add_frame(scan_res.scan); // Check if we have a 180 degree scan built if (maybe_scan) { auto scan = *maybe_scan; auto front_obj_dist = scan[scan.size() / 2].dist(ScanPoint::zero()); // If object is 45cm in front of kart, stop (0.0 means bad point) if (front_obj_dist != 0.0 && front_obj_dist < 0.45 + 0.1524) { tinyKart->pause(); digitalWrite(LED_YELLOW, HIGH); } // Find target point TODO tune your params auto maybe_target_pt = find_gap_naive(scan, 10, 2) if (maybe_target_pt) { auto target_pt = *maybe_target_pt; logger.printf("Target point: (%hi,%hi)\n", (int16_t) (target_pt.x * 1000), (int16_t) (target_pt.y * 1000)); // Find command to drive to point auto command = pure_pursuit::calculate_command_to_point(tinyKart, target_pt, 1.0); // Set throttle proportional to distance to point in front of kart command.throttle_percent = mapfloat(front_obj_dist, 0.1, 10.0, 0.15, tinyKart->get_speed_cap()); logger.printf("Command: throttle %hu, angle %hi\n", (uint16_t) (command.throttle_percent * 100), (int16_t) (command.steering_angle)); // Actuate kart tinyKart->set_forward(command.throttle_percent); tinyKart->set_steering(command.steering_angle); } } } else { switch (scan_res.error) { case ScanResult::Error::CRCFail: logger.printf("CRC error!\n"); break; case ScanResult::Error::HeaderByteWrong: logger.printf("Header byte wrong!\n"); break; } } }
} Don't worry about the loop much for now, as it contains the path tracker you will be making next chapter. A reference implementation is included here to ensure that you can test your planner. All you need to work on for now is find_gap_naive, which will contain the algorithm detailed above. Once you have a complete implementation, test it with the tinykart in a relatively constrained space, so the lidar can see things. Don't stress too much if it isn't perfect, but try to hack on the algorithm until you're confident you can't make it better. This will likely take quite a long time, possibly days depending on how much time you have to work on TinyKart. Feel free to take your time with this, and ensure you understand what is happening. This process will be very similar to when you're working on it yourself, so its important to get this down. If you're ever completely stuck, there is a reference implementation in libs/gap_follow/naive_gap_follow.cpp. I would still try to finish this yourself though, because there are many ways to approach this implementation and things only get more complex from here.
